export default {
  name: 'AdminLTEAlert',
  data() {
    return {
      isDismissable: this.dismissable,
      internalVisible: this.visible
    };
  },
  computed: {
    icon: function () {
      switch (this.color) {
        case 'info':
          return 'fa-info';
        case 'success':
          return 'fa-check';
        case 'danger':
          return 'fa-ban';
        case 'warning':
          return 'fa-warning';
        default:
          return 'fa-info';
      }
    }
  },
  props: {
    color: {
      type: String,
      default: 'info',
      validator: value => {
        let valid = ['', 'success', 'danger', 'warning', 'info'];
        return valid.includes(value);
      }
    },
    visible: {
      type: Boolean,
      default: true
    },
    title: {
      type: String,
      default: 'Alert!'
    },
    dismissable: {
      type: Boolean,
      default: true
    },
    noTitle: {
      type: Boolean,
      default: false
    }
  }
};
module.exports = exports['default'];

