export default {
  name: 'AdminLTEBox',
  data() {
    return {
      isCollapsed: this.collapsed,
      isCollapsable: this.collapsable,
      isRemovable: this.removable,
      isLoading: this.loading,
      isSolid: this.solid,
      headerHaveBorder: this.borderHeader,
      removed: false
    };
  },
  computed: {
    collapseIcon: function () {
      return this.isCollapsed ? 'fa-plus' : 'fa-minus';
    },
    borderOnHeader: function () {
      if (this.noTitle) return false;
      return this.headerHaveBorder;
    }
  },
  props: {
    collapsed: {
      type: Boolean,
      default: false
    },
    collapsable: {
      type: Boolean,
      default: true
    },
    removable: {
      type: Boolean,
      default: true
    },
    loading: {
      type: Boolean,
      default: false
    },
    solid: {
      type: Boolean,
      default: false
    },
    borderHeader: {
      type: Boolean,
      default: true
    },
    color: {
      type: String,
      default: 'default',
      validator: value => {
        let valid = ['', 'primary', 'info', 'danger', 'warning', 'success', 'default'];
        return valid.includes(value);
      }
    },
    noTitle: {
      type: Boolean,
      default: false
    }
  },
  watch: {
    collapsed: function () {
      this.isCollapsed = this.collapsed;
    },
    loading: function () {
      this.isLoading = this.loading;
    },
    removed: function () {
      this.removed ? this.$emmit('removed') : this.$emmit('unremoved');
    },
    isCollapsed: function () {
      this.isCollapsed ? this.$emmit('collapsed') : this.$emmit('expanded');
    },
    isLoading: function () {
      this.isLoading ? this.$emmit('loading') : this.$emmit('unloaded');
    }
  },
  methods: {
    hasFooterSlot() {
      return !!this.$slots['footer'];
    },
    load() {
      this.isLoading = true;
    },
    unload() {
      this.isLoading = false;
    },
    collapse() {
      this.isCollapsed = true;
    },
    uncollapse() {
      this.isCollapsed = false;
    },
    expand() {
      this.isCollapsed = false;
    },
    unexpand() {
      this.isCollapsed = false;
    },
    toogle() {
      this.isCollapsed = !this.isCollapsed;
    },
    remove() {
      this.removed = true;
    }
  }
};
module.exports = exports['default'];

