/* global $ */
export default {
  name: 'AdminLTEModal',
  data() {
    return {
      isCancellable: this.cancellable,
      isOkable: this.ok
    };
  },
  props: {
    color: {
      type: String,
      default: '',
      validator: value => {
        let valid = ['', 'primary', 'info', 'danger', 'warning', 'success'];
        return valid.includes(value);
      }
    },
    cancellable: {
      type: Boolean,
      default: true
    },
    cancelText: {
      type: String,
      default: 'Cancel'
    },
    ok: {
      type: Boolean,
      default: true
    },
    okText: {
      type: String,
      default: 'Ok'
    },
    footer: {
      type: Boolean,
      default: true
    },
    show: {
      type: Boolean,
      default: false
    }
  },
  watch: {
    show: function (newValue) {
      if (newValue) {
        this.showDialog();
      } else {
        this.hideDialog();
      }
    }
  },
  methods: {
    hasFooterSlot() {
      return !!this.$slots['footer'] || this.footer;
    },
    showDialog() {
      $(this.$el).modal('show');
    },
    hideDialog() {
      $(this.$el).modal('hide');
    },
    toogle() {
      $(this.$el).modal('toggle');
    }
  },
  mounted() {
    var component = this;
    $(this.$el).on('hidden.bs.modal', function () {
      component.$emit('hide');
      if (component.$events) component.$events.fire('hideDialog');
    });
  }
};
module.exports = exports['default'];

